import styled from 'styled-components/native';

export const Container = styled.View`
width: 100%;
height: 100%;
align-items: center;
justify-content: center;
`;

export const Roxo = styled.View`
position: absolute;
bottom: 0;
background-color: #677689;
width: 100%;
height: 60%;
`;

export const CircleRoxo = styled.View`
position: relative;
background-color: #677689;
top: 200px;
width: 100%;
height: 100%;
border-radius: 300px;
margin: 50px;
}
`;

export const Smartmobile = styled.Text`
position: relative;
color: #677689;
font-size: 40px;
margin-bottom: 5px;
`;

export const User = styled.TextInput` 
background-color: #dbdbdb;
`;
